import './App.css';
import Navbar from './components/Navbar/Navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';



function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path ='/' element={<Shop/>}/>
          <Route path ='/mens' element={<ShopCategory/>}/>
          <Route path ='/womens' element={<ShopCategory/>}/>
          <Route path ='/' element={<Shop/>}/>
        </Routes>
      </BrowserRouter>


    </div>
  );
}

export default App;
